package parser

import (
	"encoding/json"
	"ethTx/cmd/util/logging"
	"sync"
	"testing"
)

func TestBlockParser_processBlockTransactions(t *testing.T) {
	type fields struct {
		observedAddrs map[string]int
	}
	type args struct {
		blockData map[string]interface{}
	}
	tests := []struct {
		name   string
		fields fields
		args   args
	}{
		// TODO: Add test cases.
		{
			name: "test numero uno",
			fields: fields{observedAddrs: map[string]int{
				"0x98c3d3183c4b8a650614ad179a1a98be0a8d6b8e": 1,
				"0x3a10dc1a145da500d5fba38b9ec49c8ff11a981f": 1,
				"0xdac17f958d2ee523a2206206994597c13d831ec7": 12,
				"0x95ad61b0a150d79219dcf64e1e6cc01f0b64c4ce": 2,
				"0xe5901847b5191fce33cef4260d9a0c06b819fc3d": 1,
			}},
		},
	}
	logging.Init("debug")
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			bp := &BlockParser{
				mu:            sync.Mutex{},
				transactions:  make(map[string][]Transaction),
				observedAddrs: make(map[string]struct{}),
			}

			for addr := range tt.fields.observedAddrs {
				bp.Subscribe(addr)
			}

			json.Unmarshal([]byte(block), &tt.args.blockData)
			bp.processBlockTransactions(tt.args.blockData)

			for addr, noOfTx := range tt.fields.observedAddrs {
				if len(bp.transactions[addr]) != noOfTx {
					t.Log(addr)
					t.Fail()
				}
			}

		})
	}
}

